import React from "react"
import ReactDOM from "react-dom/client";

import {
    Error,
    Footer,
    Login,
    Navbar,
    Posts,
    Profile,
    SinglePost
} from "./components"

function App(){
    // return <div> hi </div>
    return(
        <>
            <Error/>
            <Footer/>
            <Login/>
            <Navbar/>
            <Posts/>
            <Profile/>
            <SinglePost/>
        </>
    )
}


const root = ReactDOM.createRoot(document.getElementById("app"))
root.render(<App/>)
